import React from "react";




export default function Header({ style }) {
  return (
    <div
      style={{
        position: "absolute",
        top: 0,
        left: 0,
        width: "auto",
        height: "25px",
        background: "black",
        borderRadius: "4px",
        border: "1px solid #333",
        ...style
      }}
    />
  );
}
